echo "extra-keys = [['/','CTRL','ENTER','*','LEFT','.','RIGHT'],['$a','$b','$c','$d','$e','DOWN','$f']]" >> $HOME/.termux/termux.properties
echo -e " $a $b $c $d $e $f "
echo "$likho"
fi
